import React from "react";
import "./style.css";
import Button from "./Button";

const App = () => {
	return (
		<div>
			<input
				type="text"
				name="username"
				id="txt_username"
				className="txt_username"
			/>
			<input
				type="submit"
				name="Submit"
				value="Submit"
				className="button"
			/>
		</div>
	);
};

export default App;
